import './App.css';
import {BrowserRouter,Switch,Route,Redirect} from 'react-router-dom';
import Login from './Login';
import Content from './Content';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route exact path='/' component={()=><Login/>}/>
          <Route exact path='/content' component={()=><Content/>}/>
          <Redirect to='/'/>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
